import React from "react";
const blobs = [1, 2, 3];

export default function Day({ value = 0 }) {
  return (
    <div
      style={{
        border: "1px solid green",
        flex: 1,
        height: 50,
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-end",
      }}
    >
      {blobs.map((blob, i) => {
        return (
          <div
            className="dayBlob"
            style={i < value ? { background: "green" } : null}
          >
            {i}
          </div>
        );
      })}
    </div>
  );
}
